schema:
{
 "description": "RemoteSubnetSpec defines the desired state of RemoteSubnet",
 "properties": {
  "clusterName": {
   "description": "ClusterName is the name of parent cluster who owns this remote subnet.",
   "type": "string"
  },
  "networkType": {
   "description": "Type is the network type of this remote subnet. Now there are two known types, Overlay and Underlay.",
   "type": "string"
  },
  "range": {
   "description": "Range is the IP collection of this remote subnet.",
   "properties": {
    "cidr": {
     "type": "string"
    },
    "end": {
     "type": "string"
    },
    "excludeIPs": {
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "gateway": {
     "type": "string"
    },
    "reservedIPs": {
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "start": {
     "type": "string"
    },
    "version": {
     "type": "string"
    }
   },
   "required": [
    "cidr",
    "version"
   ],
   "type": "object"
  }
 },
 "required": [
  "range"
 ],
 "title": "Remote Subnet",
 "type": "object"
}
